    const goToTour = (e) => {
      e.preventDefault();
     < Tour choice = {props.DATA} />
    }
    return (


      <div className='maino'>    
        {props.DATA1.map((tour) => (
          <div key={tour.id} className='tour'>
            <h2>{tour.name}</h2>
            <img src={tour.image} alt={tour.name} />
            <button onClick={goToTour}>Learn more</button>





          </div>  

        ))}
     </div>

    );
  }
  export default Tours;
